import React from "react";
import OneBook from "./OneBook";

const BookHolder = (props) => {
  const myBooks = props.booksB.map((bb) => {
    props.books.map((book) => {
      if (bb.id === book.id) {
        bb.shelf = book.shelf;
      }
      return bb;
    });
    //   return book;
  });

  return (
    <div>
      {myBooks.map((book) => (
        <OneBook key={book.id} book={myBooks} />
      ))}
    </div>
  );
};

export default BookHolder;
